const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`An interactive analytics dashboard serves several purposes. They allow you to share data and provide you with all those vital information to make game-changing decisions at a faster pace. Building a real-time dynamic dashboard using a traditional relational database might require a complex set of queries. By using a NoSQL database like Redis, you can build a powerful interactive and dynamic dashboard with a small number of Redis commands. `}</p>
    <p>{`This tutorial shows a basic analytics dashboard app that uses Redis Bitmap written in NodeJS (JavaScript)`}</p>
    <div class="text--center">
      <iframe width="760" height="415" src="https://www.youtube.com/embed/Ugym4yUeIhA" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <h3 {...{
      "id": "step-1-prepare-the-environment"
    }}>{`Step 1. Prepare the environment`}</h3>
    <ul>
      <li parentName="ul">{`Install Node - v12.19.0`}</li>
      <li parentName="ul">{`Install NPM - v6.14.8`}</li>
      <li parentName="ul">{`Install Docker - v19.03.13 (optional)`}</li>
    </ul>
    <h3 {...{
      "id": "step-2-clone-the-repository"
    }}>{`Step 2. Clone the repository`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` git clone https://github.com/redis-developer/basic-analytics-dashboard-redis-bitmaps-nodejs
`}</code></pre>
    <h3 {...{
      "id": "step-3-setting-up-backend"
    }}>{`Step 3. Setting up backend`}</h3>
    <p>{`First we will be settin up environmental variables`}</p>
    <p>{`Go to /server folder (cd ./server) and then execute the below command:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` cp .env.example .env
`}</code></pre>
    <h3 {...{
      "id": "step-4-install-dependencies"
    }}>{`Step 4. Install dependencies`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` npm install
`}</code></pre>
    <h3 {...{
      "id": "step-5-run-docker-compose-to-install-redis"
    }}>{`Step 5. Run Docker Compose to install Redis`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` docker network create global
 docker-compose up -d --build
`}</code></pre>
    <h3 {...{
      "id": "step-6-run-the-backend"
    }}>{`Step 6. Run the backend`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` npm run dev
`}</code></pre>
    <h3 {...{
      "id": "step-7-setting-up-the-frontend"
    }}>{`Step 7. Setting up the frontend`}</h3>
    <p>{`Go to /client folder (cd ./client) and then:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` cp .env.example .env
`}</code></pre>
    <h3 {...{
      "id": "step-8--install-dependencies"
    }}>{`Step 8.  Install dependencies`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` npm install
`}</code></pre>
    <h3 {...{
      "id": "step-9-run-the-frontend"
    }}>{`Step 9. Run the frontend`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` npm run serve
`}</code></pre>
    <p><img alt={"analytics"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./analytics_traffic.png").default} /></p>
    <h3 {...{
      "id": "how-does-it-work"
    }}>{`How does it work?`}</h3>
    <h4 {...{
      "id": "how-the-data-is-stored"
    }}>{`How the data is stored:`}</h4>
    <p>{`The event data is stored in various keys and various data types.`}</p>
    <p>{`For each of time spans:`}</p>
    <ul>
      <li parentName="ul">{`year: like 2021`}</li>
      <li parentName="ul">{`month: like 2021-03 (means March of 2021)`}</li>
      <li parentName="ul">{`day: like 2021-03-03 (means 3rd March of 2021)`}</li>
      <li parentName="ul">{`weekOfMonth: like 2021-03/4 (means 4th week of March 2021)`}</li>
      <li parentName="ul">{`anytime`}</li>
    </ul>
    <p>{`and for each of scopes:`}</p>
    <ul>
      <li parentName="ul">{`source`}</li>
      <li parentName="ul">{`action`}</li>
      <li parentName="ul">{`source + action`}</li>
      <li parentName="ul">{`action + page`}</li>
      <li parentName="ul">{`userId + action`}</li>
      <li parentName="ul">{`global`}</li>
    </ul>
    <p>{`and for each of data types (types):`}</p>
    <ul>
      <li parentName="ul">{`count (Integer stored as String)`}</li>
      <li parentName="ul">{`bitmap`}</li>
      <li parentName="ul">{`set`}</li>
    </ul>
    <p>{`Is generated key like: `}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` rab:{type}[:custom:{customName}][:user:{userId}][:source:{source}][:action:{action}][:page:{page}]:timeSpan:{timeSpan}
`}</code></pre>
    <p>{`where values in [] are optional.`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`For each generated key like rab:count:*, data is stored like: INCR {key}
Example:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` INCR rab:count:action:addToCart:timeSpan:2015-12/3
`}</code></pre>
      </li>
      <li parentName="ul">
        <p parentName="li">{`For each generated key like: rab:set:*, data is stored like: SADD {key} {userId}
Example:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` SADD rab:set:action:addToCart:timeSpan:2015-12/3 8
`}</code></pre>
      </li>
      <li parentName="ul">
        <p parentName="li">{`For each generated key like rab:bitmap:*, data is stored like: SETBIT {key} {userId} 1.
Example:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` SETBIT rab:bitmap:action:addToCart:timeSpan:2015-12/3 8 1
`}</code></pre>
      </li>
    </ul>
    <h3 {...{
      "id": "cohort-data"
    }}>{`Cohort data`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`We store users who register and then bought some products (action order matters).`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`For each buy action in December we check if user performed register action before (register counter must be greater than zero).`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`If so, we set user bit to 1 like: SETBIT rab:bitmap:custom:cohort-buy:timeSpan:{timeSpan} {userId} 1`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`E.g User Id 2 bought 2 products on 2015-12-17. It won't be stored.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`E.g User Id 10 bought 1 product on 2015-12-17 and registered on 2015-12-16.
It will be stored like: SETBIT rab:bitmap:custom:cohort-buy:timeSpan:2015-12 10 1.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`We assume that user cannot buy without register.`}</p>
      </li>
    </ul>
    <h4 {...{
      "id": "retention-data"
    }}>{`Retention data`}</h4>
    <ul>
      <li parentName="ul">{`Retention means users who bought on two different dates`}</li>
      <li parentName="ul">{`For each buy action we check if user bought more products anytime than bought on particular day (current purchase not included).`}</li>
      <li parentName="ul">{`If so, we add user id to set like: SADD rab:set:custom:retention-buy:timeSpan:{timeSpan} {userId}`}</li>
      <li parentName="ul">{`E.g User Id 5 bought 3 products on 2015-12-15. His retention won't be stored (products bought on particular day: 2, products bought anytime: 0).`}</li>
      <li parentName="ul">{`E.g User Id 3 bought 1 product on 2015-12-15 and before - 1 product on 2015-12-13. His retention will be stored (products bought on particular day: 0, products bought anytime: 1) like: SADD rab:set:custom:retention-buy:timeSpan:2015-12 3.`}</li>
    </ul>
    <h4 {...{
      "id": "how-the-data-is-accessed"
    }}>{`How the data is accessed:`}</h4>
    <ul>
      <li parentName="ul">{`Total Traffic:`}</li>
    </ul>
    <p>{`December: `}<inlineCode parentName="p">{`BITCOUNT rab:bitmap:custom:global:timeSpan:2015-12`}</inlineCode>{`
X week of December: `}<inlineCode parentName="p">{`BITCOUNT rab:bitmap:custom:global:timeSpan:2015-12/{X}`}</inlineCode>{`
Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` BITCOUNT rab:bitmap:custom:global:timeSpan:2015-12/3
`}</code></pre>
    <ul>
      <li parentName="ul">{`Traffic per Page ({page} is one of: homepage, product1, product2, product3):`}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`December: BITCOUNT rab:bitmap:action:visit:page:{page}:timeSpan:2015-12
`}</code></pre>
    <p>{`Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` BITCOUNT rab:bitmap:action:visit:page:homepage:timeSpan:2015-12
`}</code></pre>
    <ul>
      <li parentName="ul">{`X week of December: `}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`BITCOUNT rab:bitmap:action:visit:page:{page}:timeSpan:2015-12/{X}
`}</code></pre>
    <p>{`Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` BITCOUNT rab:bitmap:action:visit:page:product1:timeSpan:2015-12/2
`}</code></pre>
    <ul>
      <li parentName="ul">{`Traffic per Source ({source} is one of: google, Facebook, email, direct, referral, none):`}</li>
    </ul>
    <p>{`December: `}</p>
    <pre><code parentName="pre" {...{}}>{`BITCOUNT rab:bitmap:source:{source}:timeSpan:2015-12
`}</code></pre>
    <p>{`Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` BITCOUNT rab:bitmap:source:referral:timeSpan:2015-12
`}</code></pre>
    <ul>
      <li parentName="ul">{`X week of December: `}<inlineCode parentName="li">{`BITCOUNT rab:bitmap:source:{source}:timeSpan:2015-12/{X}`}</inlineCode></li>
    </ul>
    <p>{`Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` BITCOUNT rab:bitmap:source:google:timeSpan:2015-12/1
`}</code></pre>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Trend traffic ({page} is one of: homepage, product1, product2, product3):`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`December: from `}<inlineCode parentName="p">{`BITCOUNT rab:bitmap:action:visit:{page}:timeSpan:2015-12-01`}</inlineCode>{` to `}<inlineCode parentName="p">{`BITCOUNT rab:bitmap:action:visit:{page}:timeSpan:2015-12-31`}</inlineCode></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`1 Week of December: Similar as above, but from 2015-12-01 to 2015-12-07`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`2 Week of December: Similar as above, but from 2015-12-08 to 2015-12-14`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`3 Week of December: Similar as above, but from 2015-12-15 to 2015-12-21`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`4 Week of December: Similar as above, but from 2015-12-22 to 2015-12-28`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`5 Week of December: Similar as above, but from 2015-12-29 to 2015-12-31`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Example:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` BITCOUNT rab:bitmap:action:visit:homepage:timeSpan:2015-12-29 => BITCOUNT rab:bitmap:action:visit:homepage:timeSpan:2015-12-30 => BITCOUNT rab:bitmap:action:visit:homepage:timeSpan:2015-12-31
`}</code></pre>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Total products bought:`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`December: `}<inlineCode parentName="p">{`GET rab:count:action:buy:timeSpan:2015-12`}</inlineCode></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`X week of December: `}<inlineCode parentName="p">{`GET rab:count:action:buy:timeSpan:2015-12/{X}`}</inlineCode>{`
Example:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` GET rab:count:action:buy:timeSpan:2015-12/1
`}</code></pre>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Total products added to cart:`}</p>
      </li>
    </ul>
    <p>{`December: `}<inlineCode parentName="p">{`GET rab:count:action:addToCart:timeSpan:2015-12`}</inlineCode>{`
X week of December: `}<inlineCode parentName="p">{`GET rab:count:action:addToCart:timeSpan:2015-12/{X}`}</inlineCode>{`
Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` GET rab:count:action:addToCart:timeSpan:2015-12/1
`}</code></pre>
    <ul>
      <li parentName="ul">{`Shares of products bought ({productPage} is on of product1, product2, product3):`}</li>
    </ul>
    <p>{`December: `}<inlineCode parentName="p">{`GET rab:count:action:buy:page:{productPage}:timeSpan:2015-12`}</inlineCode>{`
Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` GET rab:count:action:buy:page:product3:timeSpan:2015-12
`}</code></pre>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`X week of December: `}<inlineCode parentName="p">{`GET rab:count:action:buy:page:{productPage}:timeSpan:2015-12/{X}`}</inlineCode>{`
Example:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` GET rab:count:action:buy:page:product1:timeSpan:2015-12/2
`}</code></pre>
      </li>
    </ul>
    <h4 {...{
      "id": "customer-and-cohort-analysis"
    }}>{`Customer and Cohort Analysis`}</h4>
    <ul>
      <li parentName="ul">{`People who registered: BITCOUNT rab:bitmap:action:register:timeSpan:2015-12`}</li>
      <li parentName="ul">{`People who register then bought (order matters): BITCOUNT rab:bitmap:custom:cohort-buy:timeSpan:2015-12`}</li>
      <li parentName="ul">{`Dropoff: (People who register then bought / People who register) * 100 `}{`[%]`}</li>
      <li parentName="ul">{`Customers who bought only specified product ({productPage} is one of: product1, product2, product3): `}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`SMEMBERS rab:set:action:buy:page:{productPage}:timeSpan:2015-12
`}</code></pre>
    <p>{`Example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` SMEMBERS rab:set:action:buy:page:product2:timeSpan:2015-12
`}</code></pre>
    <ul>
      <li parentName="ul">{`Customers who bought Product1 and Product2: `}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`SINTER rab:set:action:buy:page:product1:timeSpan:anytime rab:set:action:buy:page:product2:timeSpan:anytime
`}</code></pre>
    <ul>
      <li parentName="ul">{`Customer Retention (customers who bought on the different dates): SMEMBERS rab:set:custom:retention-buy:timeSpan:anytime`}</li>
    </ul>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/redis-developer/basic-analytics-dashboard-redis-bitmaps-nodejs"
        }}>{`Complete Source Code`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redis.io/topics/data-types-intro"
        }}>{`Use cases of Bitmaps`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
